import React from 'react';
import './navbar.css';
import logo from '../../asset/realnet.png';
import { Link } from 'react'

const Navbar = () => {
    return (
        <nav className="navbar">
            <img src={logo} alt='Logo' className='logo'/>
            <div className='desktopmenu'>
            </div>
        </nav>
    )
}

export default Navbar;
